.box {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  width: 25rem;
  padding: 2.5rem;
  /*border-bottom: 0.065rem solid #fff;
  outline: none;*/
  box-sizing: border-box;
  background: #4524c7f5;
  border-radius: 1.625rem;
  box-shadow: 2px 2px 10px 10px rgb(97 94 94 / 49%);
}

.box h2 {
  margin: 0 0 1.875rem;
  padding: 0;
  color: #fff;
  text-align: center;
}

.box .inputBox {
  position: relative;
}
/*border-bottom: 0.065rem solid #fff;
  outline: none;*/
.box .inputBox input {
  width: 100%;
  padding: 0.625rem 0;
  font-size: 1rem;
  color: #fff;
  letter-spacing: 0.062rem;
  margin-bottom: 1.875rem;
  border: none;
  border-bottom: 0.065rem solid #fff;
  outline: none;
  background: transparent;
}
/*border-bottom: 0.065rem solid #fff;
  outline: none;*/
.box .inputBox label {
  position: absolute;
  top: 0;
  left: 0;
  padding: 0.625rem 0;
  font-size: 1rem;
  color: #fff;
  pointer-events: none;
  transition: 0.5s;
}
/*border-bottom: 0.065rem solid #fff;
  outline: none;*/
.box .inputBox input:focus ~ label,
.box .inputBox input:valid ~ label,
.box .inputBox input:not([value=""]) ~ label {
  top: -1.125rem;
  left: 0;
  color: #03a9f4;
  font-size: 0.75rem;
}
.box button {
  border: none;
  outline: none;
  color: #fff;
  background-color: #ff1919;
  width: 100%;
  margin-top: 20px;
  padding: 0.625rem 1.25rem;
  cursor: pointer;
  font-weight:bold;
  border-radius: 0.312rem;
  font-size: 1.1rem;
}
/*border-bottom: 0.065rem solid #fff;
  outline: none;*/
 button:hover {
  background-color: #ff19ce;
}

 @media only screen and (max-width: 600px) {
	.box {
    width: 90%;

.box button {
font-size: 1.02rem;
}

	}}

</style>
